import React from "react";

function MyComponent(props) {
  return (
    <>
      {process.env.NODE_ENV === "development" && (
        <>
          <h2>{process.env.REACT_APP_API_URL}</h2>
        </>
      )}
    </>
  );
}

export default MyComponent;
